/** Returns the ExportDeviceConfig node.
 *
 * If the Object has not been created yet, this method creates the node and returns it.
 */
MoxaClassBased::ExportDeviceConfigStateMachineType* OperationFolderTypeBase::getExportDeviceConfig()
{
    if ( m_pExportDeviceConfig == NULL )
    {
        UaStatus addStatus;

        UaString sNodeId = nodeId().toString() + ".ExportDeviceConfig";
        UaNodeId objectNodeId(sNodeId, nodeId().namespaceIndex());
        m_pExportDeviceConfig = new MoxaClassBased::ExportDeviceConfigStateMachineType(objectNodeId, s_pExportDeviceConfig, m_pNodeConfig, m_pSharedMutex);
        addStatus = m_pNodeConfig->addNodeAndReference(this, m_pExportDeviceConfig, OpcUaId_HasComponent);
        UA_ASSERT(addStatus.isGood());
    }
    return m_pExportDeviceConfig;
}

