/** Uses the NodeAccessInfo of pOther and its children. */
void OperationFolderTypeBase::useAccessInfoFromInstance(OperationFolderTypeBase *pOther)
{
    OpcUa::FolderType::useAccessInfoFromInstance(pOther);

    // children
    if (m_pExportDeviceConfig && pOther->m_pExportDeviceConfig)
    {
        m_pExportDeviceConfig->useAccessInfoFromInstance(pOther->m_pExportDeviceConfig);
    }
    if (m_pExportEventLog && pOther->m_pExportEventLog)
    {
        m_pExportEventLog->useAccessInfoFromInstance(pOther->m_pExportEventLog);
    }
    if (m_pFactoryDefault && pOther->m_pFactoryDefault)
    {
        m_pFactoryDefault->useAccessInfoFromInstance(pOther->m_pFactoryDefault);
    }
    if (m_pFirmwareUpgrade && pOther->m_pFirmwareUpgrade)
    {
        m_pFirmwareUpgrade->useAccessInfoFromInstance(pOther->m_pFirmwareUpgrade);
    }
    if (m_pImportDeviceConfig && pOther->m_pImportDeviceConfig)
    {
        m_pImportDeviceConfig->useAccessInfoFromInstance(pOther->m_pImportDeviceConfig);
    }
    if (m_pReboot && pOther->m_pReboot)
    {
        m_pReboot->useAccessInfoFromInstance(pOther->m_pReboot);
    }
    if (m_pSyncDeviceConfig && pOther->m_pSyncDeviceConfig)
    {
        m_pSyncDeviceConfig->useAccessInfoFromInstance(pOther->m_pSyncDeviceConfig);
    }
}

/** Set the NodeAccessInfo for this node and all of its children. */
void OperationFolderTypeBase::setAccessInfoWithChildren(NodeAccessInfo* pNodeAccessInfo)
{
    OpcUa::FolderType::setAccessInfoWithChildren(pNodeAccessInfo);

    // children
    if (m_pExportDeviceConfig)
    {
        m_pExportDeviceConfig->setAccessInfoWithChildren(pNodeAccessInfo);
    }
    if (m_pExportEventLog)
    {
        m_pExportEventLog->setAccessInfoWithChildren(pNodeAccessInfo);
    }
    if (m_pFactoryDefault)
    {
        m_pFactoryDefault->setAccessInfoWithChildren(pNodeAccessInfo);
    }
    if (m_pFirmwareUpgrade)
    {
        m_pFirmwareUpgrade->setAccessInfoWithChildren(pNodeAccessInfo);
    }
    if (m_pImportDeviceConfig)
    {
        m_pImportDeviceConfig->setAccessInfoWithChildren(pNodeAccessInfo);
    }
    if (m_pReboot)
    {
        m_pReboot->setAccessInfoWithChildren(pNodeAccessInfo);
    }
    if (m_pSyncDeviceConfig)
    {
        m_pSyncDeviceConfig->setAccessInfoWithChildren(pNodeAccessInfo);
    }
}


